<?php

namespace App\Tests\Service;

use App\Service\FileUploader;
use League\Flysystem\FilesystemOperator;
use PHPUnit\Framework\TestCase;
use PHPUnit\Framework\MockObject\MockObject;

class FileUploaderUnitTest extends TestCase
{

    public function testSuccessUploadBase64Image()
    {
        $base64Image = "data:image/jpeg;base64,";

        $data = explode(',', $base64Image);
        /**
         * @var FilesystemOperator&MockObject $filesystem
         */
        $filesystem = $this->getMockBuilder(FilesystemOperator::class)
            ->disableOriginalConstructor()
            ->getMock();
        $filesystem
            ->expects(self::exactly(1))
            ->method('write')
            ->with($this->isType('string'), base64_decode($data[1]));
        $fileUploader = new FileUploader($filesystem);
        $path = $fileUploader->uploadBase64File($base64Image);
        $this->assertNotEmpty($path);
        $this->assertStringContainsString('.jpeg', $path);

    }
}
